import { Sidebar } from '../components/Sidebar/Sidebar';
import { CategoriesElements } from '../components/Categories/CategoriesElements';
import comparsa1 from '../images/comparsa/comparsa-la-eternidad-martinez-ares.jpg';
import comparsa2 from '../images/comparsa/230120-oh-capitan-mi-capitan-154.jpg';
import comparsa3 from '../images/comparsa/chusma-selecta-ok.jpg';
import comparsa4 from '../images/comparsa/310120-los_encaidenados-107.jpg';
import chirigota from '../images/chirigota-los-cadizfornia.jpg';
import cuarteto from '../images/Cuarteto-cuarteto-More_1438667002_117267025_667x375.jpg';
import coro from '../images/Coro-Creaciones-SA.jpg';




export const Creator = () => {

    const firstArray = [comparsa, chirigota, cuarteto, coro];
    const randomItem = firstArray[Math.floor(Math.random() * firstArray.length)];


    return (
        <>
            <div className="creator">
                <Sidebar />
                <CategoriesElements className="cardSize" children="comparsa" image={<img src={randomItem} alt={"asd"} />} />
                <CategoriesElements className="cardSize" children="chirigota" image={<img src={chirigota} alt="Chirigota" />} />
                <CategoriesElements className="cardSize" children="cuarteto" image={<img src={cuarteto} alt="Cuarteto" />} />
                <CategoriesElements className="cardSize" children="coro" image={<img src={coro} alt="Coro" />} />
            </div>
        </>
    );
}
